import React, { useState, useEffect } from 'react';
import { View, Text, TextInput, TouchableOpacity, StyleSheet } from 'react-native';
import { colors } from '../../utils/colors';
import ChatUI from '../../components/Chat/ChatUI';
import Navbar from '../../components/Navbar';
import { getUrlParams } from '../../utils/urlUtils';

// Add Space Grotesk font
const spaceGrotesk = {
  fontFamily: "'Space Grotesk', sans-serif",
  fontDisplay: 'swap'
};

// Add font import to head
if (typeof document !== 'undefined') {
  const link = document.createElement('link');
  link.href = 'https://fonts.googleapis.com/css2?family=Space+Grotesk:wght@300;400;500;600;700&display=swap';
  link.rel = 'stylesheet';
  document.head.appendChild(link);
}

export default function LandingPage() {
  const { ref, questions, refOffer } = getUrlParams();
  const [showChat, setShowChat] = useState(false);
  const [referralCode, setReferralCode] = useState('');
  const [deferredPrompt, setDeferredPrompt] = useState(null);
  const [showInstallPrompt, setShowInstallPrompt] = useState(false);

  useEffect(() => {
    // Register service worker
    if ('serviceWorker' in navigator) {
      window.addEventListener('load', () => {
        navigator.serviceWorker.register('/service-worker.js')
          .then(registration => {
            console.log('ServiceWorker registration successful');
          })
          .catch(err => {
            console.log('ServiceWorker registration failed: ', err);
          });
      });
    }

    // Handle PWA install prompt
    window.addEventListener('beforeinstallprompt', (e) => {
      e.preventDefault();
      setDeferredPrompt(e);
      setShowInstallPrompt(true);
    });
  }, []);

  const handleInstallClick = async () => {
    if (!deferredPrompt) return;

    setShowInstallPrompt(false);
    deferredPrompt.prompt();

    const { outcome } = await deferredPrompt.userChoice;
    console.log(`User ${outcome} the PWA installation`);
    setDeferredPrompt(null);
  };

  return (
    <View style={styles.container}>
      <Navbar onGetStarted={() => setShowChat(true)} />
      <View style={styles.content}>
        {showChat ? (
          <ChatUI 
            questionsBeforeLogin={questions} 
            showRefOffer={refOffer}
          />
        ) : (
          <>
            {/* Banner Section */}
            <View style={styles.banner}>
              <View style={styles.bannerContent}>
                <Text style={styles.bannerTitle}>
                  Turn Your Dreams into Reality with AI
                </Text>
                <Text style={styles.bannerSubtitle}>
                  Join thousands of dreamers and doers who are using AI to discover their path
                </Text>
                <View style={styles.referralInput}>
                  <TextInput
                    style={styles.input}
                    placeholder="Enter referral code"
                    placeholderTextColor={colors.text.tertiary}
                    value={referralCode}
                    onChangeText={setReferralCode}
                  />
                  <TouchableOpacity 
                    style={styles.tryNowButton}
                    onPress={() => setShowChat(true)}
                  >
                    <Text style={styles.tryNowButtonText}>Try Now</Text>
                  </TouchableOpacity>
                </View>
                {showInstallPrompt && (
                  <TouchableOpacity 
                    style={styles.installButton}
                    onPress={handleInstallClick}
                  >
                    <Text style={styles.installButtonText}>ðŸ“± Add to Home Screen</Text>
                  </TouchableOpacity>
                )}
              </View>
            </View>

            {/* Info Section */}
            <View style={styles.infoSection}>
              <View style={styles.infoContainer}>
                <Text style={styles.sectionTitle}>What are HustleBots?</Text>
                <Text style={styles.infoText}>
                  HustleBots are AI-powered companions designed to help you discover and pursue your passions. 
                  Through meaningful conversations and personalized guidance, they help you unlock your potential 
                  and connect with like-minded individuals who share your ambitions.
                </Text>
              </View>
            </View>

            {/* Logos Section */}
            <View style={styles.logosSection}>
              <Text style={styles.logosSectionTitle}>Powered By</Text>
              <View style={styles.logosGrid}>
                <Text style={styles.logo}>OpenAI</Text>
                <Text style={styles.logo}>Google Cloud</Text>
                <Text style={styles.logo}>Firebase</Text>
              </View>
            </View>

            {/* Read More Section */}
            <View style={styles.readMoreSection}>
              <Text style={styles.readMoreTitle}>Want to Learn More?</Text>
              <View style={styles.readMoreLinks}>
                <TouchableOpacity 
                  style={styles.readMoreButton}
                  onPress={() => window.open('https://github.com/yourusername/hustlebot', '_blank')}
                >
                  <Text style={styles.readMoreButtonText}>GitHub</Text>
                </TouchableOpacity>
                <TouchableOpacity 
                  style={styles.readMoreButton}
                  onPress={() => window.open('/whitepaper.pdf', '_blank')}
                >
                  <Text style={styles.readMoreButtonText}>Whitepaper</Text>
                </TouchableOpacity>
              </View>
            </View>
          </>
        )}
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: colors.background.primary,
    minHeight: '100vh',
    width: '100%',
    overflow: 'hidden' // Prevent horizontal scroll
  },
  content: {
    flex: 1,
    marginTop: 64, // Height of navbar
    width: '100%',
    overflow: 'auto'
  },
  banner: {
    padding: 64,
    backgroundColor: colors.background.secondary,
    width: '100%',
    '@media (max-width: 768px)': {
      padding: 32
    },
    '@media (max-width: 480px)': {
      padding: 24
    }
  },
  bannerContent: {
    maxWidth: 1200,
    width: '90%',
    marginHorizontal: 'auto',
    alignItems: 'center',
    '@media (max-width: 480px)': {
      width: '95%'
    }
  },
  bannerTitle: {
    ...spaceGrotesk,
    fontSize: 56,
    fontWeight: '700',
    color: colors.text.primary,
    textAlign: 'center',
    marginBottom: 24,
    letterSpacing: '-1px',
    '@media (max-width: 768px)': {
      fontSize: 36
    },
    '@media (max-width: 480px)': {
      fontSize: 28,
      marginBottom: 16
    }
  },
  bannerSubtitle: {
    ...spaceGrotesk,
    fontSize: 24,
    fontWeight: '400',
    color: colors.text.secondary,
    textAlign: 'center',
    marginBottom: 48,
    maxWidth: 800,
    letterSpacing: '-0.5px',
    '@media (max-width: 768px)': {
      fontSize: 18,
      marginBottom: 32
    },
    '@media (max-width: 480px)': {
      fontSize: 16,
      marginBottom: 24
    }
  },
  referralInput: {
    flexDirection: 'column',
    gap: 16,
    width: '100%',
    maxWidth: 600,
    '@media (max-width: 768px)': {
      gap: 12
    }
  },
  input: {
    ...spaceGrotesk,
    backgroundColor: colors.background.primary,
    paddingHorizontal: 16,
    paddingVertical: 16,
    borderRadius: 8,
    fontSize: 18,
    color: colors.text.primary,
    borderWidth: 1,
    borderColor: colors.background.tertiary,
    width: '100%',
    '@media (max-width: 480px)': {
      fontSize: 16,
      paddingVertical: 12
    }
  },
  tryNowButton: {
    backgroundColor: colors.primary,
    paddingHorizontal: 32,
    paddingVertical: 16,
    borderRadius: 8,
    width: '100%',
    alignItems: 'center',
    '@media (max-width: 480px)': {
      paddingVertical: 12
    }
  },
  tryNowButtonText: {
    ...spaceGrotesk,
    color: colors.text.inverse,
    fontSize: 18,
    fontWeight: '600',
    '@media (max-width: 480px)': {
      fontSize: 16
    }
  },
  infoSection: {
    paddingVertical: 64,
    backgroundColor: colors.background.primary,
    width: '100%',
    alignItems: 'center',
    '@media (max-width: 768px)': {
      paddingVertical: 48
    },
    '@media (max-width: 480px)': {
      paddingVertical: 32
    }
  },
  infoContainer: {
    maxWidth: 1200,
    width: '90%',
    alignItems: 'center',
    '@media (max-width: 480px)': {
      width: '95%'
    }
  },
  sectionTitle: {
    ...spaceGrotesk,
    fontSize: 36,
    fontWeight: '700',
    color: colors.text.primary,
    marginBottom: 24,
    textAlign: 'center',
    letterSpacing: '-0.5px',
    '@media (max-width: 768px)': {
      fontSize: 28,
      marginBottom: 20
    },
    '@media (max-width: 480px)': {
      fontSize: 24,
      marginBottom: 16
    }
  },
  infoText: {
    ...spaceGrotesk,
    fontSize: 18,
    fontWeight: '400',
    color: colors.text.secondary,
    textAlign: 'center',
    maxWidth: 800,
    lineHeight: 28,
    letterSpacing: '-0.2px',
    '@media (max-width: 768px)': {
      fontSize: 16,
      lineHeight: 24,
      maxWidth: '100%'
    },
    '@media (max-width: 480px)': {
      fontSize: 15,
      lineHeight: 22
    }
  },
  logosSection: {
